<!doctype html>
<html lang="ko">
<head>
<meta charset="utf-8"/>
<title>SmartHull - Output (부재표)</title>
<style>
:root{
  --w:1920px; --h:1080px;
  --bg1:#ffffff; --bg2:#f4f9ff; --bg3:#e7f2ff;
  --text:#0b1324;
  --font:"Noto Sans KR","Segoe UI",Roboto,Helvetica,Arial,"Malgun Gothic",system-ui,sans-serif;
}
html,body{
  height:100%; margin:0;
  display:grid; place-items:center;
  background:#0b1220;
  font-family:var(--font);
}
.slide{
  width:var(--w); height:var(--h);
  position:relative; overflow:hidden;
  border-radius:16px;
  background:
    radial-gradient(1200px 720px at 80% 18%, var(--bg3), transparent 60%),
    radial-gradient(900px 640px at 15% 88%, var(--bg2), transparent 55%),
    linear-gradient(180deg,var(--bg1),var(--bg2));
}
.wrap{
  position:absolute; inset:0;
  color:#000;
  padding:80px 100px 70px 100px;
  box-sizing:border-box;
  display:grid;
  grid-template-rows:auto auto 1fr;
  gap:18px;
}
h1{
  margin:0;
  font-size:64px;
  font-weight:900;
  letter-spacing:-0.02em;
  color:#000;
}
.desc{
  font-size:28px;
  font-weight:900;
  color:#000;
}
.imgWrap{
  display:grid;
  place-items:center;
}

/* Two-image layout (Parts List + Weight C.O.G) */
.imgWrap.two{
  display:flex;
  flex-direction:row;
  align-items:flex-start;
  justify-content:space-between;
  gap:32px;
}
.imgWrap.two .imgBlock{
  display:flex;
  flex-direction:column;
  align-items:center;
  gap:10px;
}
.imgWrap.two .imgTitle{
  font-size:22px;
  font-weight:900;
  letter-spacing:.12em;
  color:#000;
  text-transform:uppercase;
}
.imgWrap.two img{
  height:720px;
  max-width:100%;
}
.imgWrap img{
  width: auto;
  height: 820px;
  object-fit:contain;
  display:block;
  border-radius: 10px;
  background: #fff;
}
@media (max-width:2100px){
  .slide{ transform:scale(.8); transform-origin:center; }
}
</style>
</head>
<body>
<section class="slide">
  <div class="wrap">
    <h1>OUTPUT</h1>
